import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";
import meow from '../packages/index'
Vue.config.productionTip = false;
Vue.use(meow)
new Vue({
  router,
  store,
  render: h => h(App)
}).$mount("#app");
